import { gql } from "apollo-boost";

const getProductsQuery = gql`
products {
      id
      model_name
      model_color
      model_category
    }
  }
`;

const getDealersQuery = gql`
query {
  dealers {
    model_name
    model_category
  }
}`

export { getProductsQuery };
